import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-image: linear-gradient(to bottom, #131424, #343b7c);
  display: flex;
`;
const Right = styled.div`
  flex: 1;
  background-color: red;
`;
const Left = styled.div`
  flex: 1;
  /* background-color:yellow ; */
`;
const Title = styled.h1`
  color: white;
  font-size: 76px;
  text-align:left ;
`;
const Desc = styled.p`
  width: 49%;
  color: white;
  text-align:right ;
  margin-left: 13% ;
`;
const OurMotive = () => {
  return (
    <Container>
      <Left></Left>
      <Right>
        <Title>My Ambition</Title>
        <Desc>
          Lorem, ipsum dolor sit amet consectetur adipisicing elit. Placeat
          ratione aliquid, distinctio provident iure voluptatum incidunt atque
          laborum nobis harum!
        </Desc>
      </Right>
    </Container>
  );
};

export default OurMotive;
